import React from 'react';
import {Grid, Paper} from "@material-ui/core";

class Home extends React.Component {

    constructor(props, context) {
        super(props, context);

    }

    render() {
        return (
            <>
                <h1>Pr√©sentation</h1>
                <Grid container spacing={3}>
                    <Grid item xs={12}>
                        <Paper className={this.props.paper}>xs=12</Paper>
                    </Grid>
                    <Grid item xs={6}>
                        <Paper className={this.props.paper}>xs=6</Paper>
                    </Grid>
                    <Grid item xs={6}>
                        <Paper className={this.props.paper}>xs=6</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper className={this.props.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper className={this.props.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper className={this.props.paper}>xs=3</Paper>
                    </Grid>
                    <Grid item xs={3}>
                        <Paper className={this.props.paper}>xs=3</Paper>
                    </Grid>
                </Grid>
            </>
        )
    }
}

export default Home;
